defs.script:
var running = true;
var d = window.document;
var svgns = 'http://www.w3.org/2000/svg';
var xlinkns = 'http://www.w3.org/1999/xlink';
function toggle(evt) {
    if (running) {
        window.setTimeout('init()',100);
        d.documentElement.pauseAnimations();
        running = false;
    } else {
        window.setTimeout('init(true)',100);
        window.document.documentElement.unpauseAnimations();
        running = true;
    }
}
function init(pause) {
    d.getElementById('pause').setAttributeNS(null,'display',((pause)?'inherit':'none'));
    d.getElementById('play').setAttributeNS(null,'display',((pause)?'none':'inherit'));
}
